  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        position: "absolute",
        backgroundColor: "#121212",
      }}
    >
      <Container
        className="aboutMe"
        style={{ color: "white", textAlign: "justify", paddingTop: "8vh" }}
      >
        <Box sx={{ pt: 3, pb: 3 }}>
          <Typography
            variant="subtitle1"
            color="text.secondary"
